import MainLayout from '../components/main-layout';

export default function Error() {
  return (
    <MainLayout>
      <h1>404</h1>
      <h2>Page not found :(</h2>
      <h4>Ooooups! Looks like you got lost.</h4>
    </MainLayout>
  );
}
